import classname from 'classnames/bind';
import styles from './FreatureItemComponent.module.scss';
import { ArrowRightOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';

const cx = classname.bind(styles);

function FreatureItemComponent({ srcImg, title, subTitle, colorBox }) {
    return (
        <div className={cx('box')}>
            <div className={cx('box-color')}></div>
            <div className={cx('box-content')}>
                <img src="https://warehouse-blue.vercel.app/static/media/feature1.3bd68cd8e4cd29a40d80.png" alt="" />
                <div className={cx('section-content')}>
                    <h2>Search Data</h2>
                    <p>
                        Don't worry if your data is very large, the Data Warehoue provides a search engine, which is
                        useful for making it easier to find data effectively saving time.
                    </p>
                    <Link>
                        Learn more
                        <ArrowRightOutlined />
                    </Link>
                </div>
            </div>
        </div>
    );
}

export default FreatureItemComponent;
